package cn.npnt.tiaps.vo;import java.util.Date;public class OccasionVO {	public OccasionVO(){			}	public OccasionVO(long id,String title){		this.id = id;		this.title = title;	}		private long id;	private Integer version;	private Date updateTime;	private Boolean deleted;	private String title;	private Integer index;			public long getId() {		return id;	}	public void setId(long id) {		this.id = id;	}	public Integer getVersion() {		return version;	}	public void setVersion(Integer version) {		this.version = version;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Boolean getDeleted() {		return deleted;	}	public void setDeleted(Boolean deleted) {		this.deleted = deleted;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public Integer getIndex() {		return index;	}	public void setIndex(Integer index) {		this.index = index;	}}